import { useNavigate } from 'react-router-dom';
import Footer from "./Footer";
import Header from "./Header";
import "../css/intro.css";
import { ChatBTN, HelpBTN } from "./Buttons";
import { Link } from 'react-router-dom';

const Intro = () => {
  const navigate = useNavigate();

  const handleStartClick = () => {
    navigate("/App");
  };

  return (
    <div>
      <Header />
      <div className="main-container">
        <div className="main-img"><img src="/main01.png" alt="main" /></div>
        <div className="btn-group" role="group" aria-label="Basic mixed styles example">
          <Link to="/#">
            <button type="button" className="btn btn-tutorial">튜토리얼</button>
          </Link>
          <button type="button" className="btn btn-start" onClick={handleStartClick}>
            시작하기
          </button>
        </div>
      </div>
      <ChatBTN /> <HelpBTN />
      <Footer />
    </div>
  );
}

export default Intro;
